import React from "react";

import { Row, Col, Card } from 'react-materialize';

import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import HotelPraia from '../../images/home/hotel_praia.jpg';
import Restaurante from '../../images/home/restaurante.jpg';



const Compra = ({ match }) => (
	<Route path={`${match.path}/:topicId`} component={Topic} />

);

function Topic({ match }) {
	var topic = match.params.topicId;
	if (topic.localeCompare("HotelPraia")){
		return (
			<div>
			  <img src={HotelPraia} className="responsive-img"/>
			  <h3>{topic}</h3>
			</div>
		);
	}

	
}

export default Compra;
